create table order_list (
	userId INTEGER,
	status VARCHAR(10),
	slot INTEGER,
	address TEXT,
	addressLine1 TEXT,
	landmark TEXT,
	locationId INT,
	rowNumber INT,
	expectedDeliveryDate TIMESTAMP WITH TIME ZONE,
	actualDeliveryDate TIMESTAMP WITH TIME ZONE,
	cancelledAt TIMESTAMP WITH TIME ZONE,
	cancelationReason TEXT,
	productId INT,
	sellerId INT,
	quantity INT,
	price INT,
	totalPrice DECIMAL(10,2)
);


